import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import BlurText from '../BlurText';

const menuData = [
  {
    id: 'aperitive',
    label: 'Aperitive',
    icon: '游볭',
    description: '칉ncepe탵i experien탵a culinar캒 cu aperitivele noastre',
    items: [
      'Zacusc캒 de cas캒 cu p칙ine pr캒jit캒',
      'Platou tradi탵ional rom칙nesc (br칙nzeturi, mezeluri, legume)',
      'Bruschete cu ro탳ii 탳i busuioc',
      'Salat캒 caprese cu mozzarella 탳i pesto',
    ],
  },
  {
    id: 'supe',
    label: 'Supe & Ciorbe',
    icon: '游',
    description: 'Supele tradi탵ionale rom칙ne탳ti, preparate cu ingrediente proaspete',
    items: [
      'Ciorb캒 de burt캒',
      'Ciorb캒 탵캒r캒neasc캒 de legume',
      'Sup캒 crem캒 de ciuperci',
    ],
  },
  {
    id: 'feluri',
    label: 'Feluri principale',
    icon: '游꼫',
    description: 'Felurile principale, de la tradi탵ional la interna탵ional',
    items: [
      'Tochitur캒 moldoveneasc캒 cu m캒m캒ligu탵캒',
      'File de dorad캒 cu legume la gr캒tar',
      'Piept de pui cu sos de l캒m칙ie 탳i ierburi',
      'Paste cu fructe de mare',
    ],
  },
  {
    id: 'deserturi',
    label: 'Deserturi',
    icon: '游꼻',
    description: '칉ncheia탵i masa cu deserturile noastre delicioase',
    items: [
      'Papana탳i cu sm칙nt칙n캒 탳i dulcea탵캒 de afine',
      'Tiramisu',
      'Tart캒 cu fructe de sezon',
      'Lava cake cu 칥nghe탵at캒',
    ],
  },
  {
    id: 'bauturi',
    label: 'B캒uturi & Vinuri',
    icon: '游꽁',
    description: 'Vinuri selecte 탳i b캒uturi rafinate pentru a acompania masa',
    items: [
      'Vinuri rom칙ne탳ti de cram캒 (Feteasc캒, Merlot, Sauvignon Blanc etc.)',
      'Cocktailuri clasice (Mojito, Aperol, Negroni)',
      'Cafea espresso, cappuccino',
      'Sucuri naturale & ap캒 mineral캒',
    ],
  },
];

const MenuSection = () => {
  const handleAnimationComplete = () => {
    console.log('Menu title animation completed!');
  };

  const [activeTab, setActiveTab] = useState(menuData[0].id);

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.05,
        delayChildren: 0.2,
      },
    },
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 10 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.4,
        ease: "easeOut",
      },
    },
  };

  return (
    <section className="section-padding bg-white relative">
      <div className="container-custom">
        {/* Header */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6 }}
          className="text-center mb-20"
        >
          <BlurText
            text="Meniul Restaurantului"
            className="text-4xl md:text-5xl font-display font-light text-text-primary mb-6 tracking-tight"
            delay={150}
            animateBy="words"
            direction="top"
            onAnimationComplete={handleAnimationComplete}
          />
          <p className="text-lg text-text-light max-w-2xl mx-auto leading-relaxed font-light">
            Descoper캒 preparatele noastre, de la aperitive proaspete la deserturi delicioase 탳i vinuri selecte.
          </p>
        </motion.div>

        {/* Minimalist Tab Navigation */}
        <motion.div 
          className="flex flex-wrap justify-center gap-2 mb-16"
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
        >
          {menuData.map((cat) => (
            <motion.button
              key={cat.id}
              variants={itemVariants}
              onClick={() => setActiveTab(cat.id)}
              className={`group relative px-6 py-3 rounded-full font-medium transition-all duration-300 text-sm tracking-wide ${
                activeTab === cat.id
                  ? 'bg-text-primary text-white shadow-sm'
                  : 'text-text-light hover:text-text-primary hover:bg-gray-50'
              }`}
            >
              <span className="mr-2 text-base">{cat.icon}</span>
              <span className="font-light">{cat.label}</span>
            </motion.button>
          ))}
        </motion.div>

        {/* Menu Content */}
        <div className="max-w-5xl mx-auto">
          <AnimatePresence mode="wait">
            {menuData.map((cat) =>
              activeTab === cat.id ? (
                <motion.div
                  key={cat.id}
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  exit={{ opacity: 0, y: -20 }}
                  transition={{ duration: 0.4, ease: "easeOut" }}
                  className="space-y-12"
                >
                  {/* Category Header */}
                  <motion.div
                    initial={{ opacity: 0, scale: 0.95 }}
                    animate={{ opacity: 1, scale: 1 }}
                    transition={{ delay: 0.1, duration: 0.4 }}
                    className="text-center mb-12"
                  >
                    <div className="inline-flex items-center gap-6">
                      <span className="text-5xl">{cat.icon}</span>
                      <div className="text-left">
                        <h3 className="text-3xl font-light text-text-primary mb-2 tracking-tight">{cat.label}</h3>
                        <p className="text-text-light text-lg font-light">{cat.description}</p>
                      </div>
                    </div>
                  </motion.div>

                  {/* Menu Items - Apple Style */}
                  <motion.div
                    variants={containerVariants}
                    initial="hidden"
                    animate="visible"
                    className="space-y-8"
                  >
                    {cat.items.map((item, idx) => (
                      <motion.div
                        key={idx}
                        variants={itemVariants}
                        className="group"
                      >
                        <div className="flex items-center justify-between py-6 border-b border-gray-100 hover:border-gray-200 transition-colors duration-300">
                          <div className="flex-1">
                            <p className="text-lg text-text-primary font-light leading-relaxed group-hover:text-text-primary transition-colors duration-300">
                              {item}
                            </p>
                          </div>
                          <div className="ml-8 opacity-0 group-hover:opacity-100 transition-opacity duration-300">
                            <div className="w-2 h-2 bg-text-primary rounded-full"></div>
                          </div>
                        </div>
                      </motion.div>
                    ))}
                  </motion.div>
                </motion.div>
              ) : null
            )}
          </AnimatePresence>
        </div>

        {/* Minimalist Call to Action */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6, delay: 0.3 }}
          className="text-center mt-20"
        >
          <div className="bg-gray-50 rounded-3xl p-12 max-w-2xl mx-auto">
            <h3 className="text-2xl font-light text-text-primary mb-4 tracking-tight">
              Rezerv캒 o mas캒 la restaurant
            </h3>
            <p className="text-text-light text-lg mb-8 font-light leading-relaxed">
              Pentru a v캒 asigura o experien탵캒 culinar캒 de neuitat, v캒 recomand캒m s캒 face탵i o rezervare.
            </p>
            <motion.button
              whileHover={{ scale: 1.02 }}
              whileTap={{ scale: 0.98 }}
              className="bg-text-primary text-white px-8 py-4 rounded-full font-medium text-lg shadow-sm hover:shadow-md transition-all duration-300"
              onClick={() => window.open('tel:+40759033047', '_self')}
            >
              Rezerv캒 acum
            </motion.button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default MenuSection;
